pub enum ContractError {
    Std(StdError),
    Unauthorized {
    },
    CustomError {
        val: String,
    },
    InvalidNumTokens {
        max: u32,
        min: u32,
    },
    InvalidMaxTokensPerBatchMint {
        max: u32,
        min: u32,
    },
    InvalidMaxTokensPerBatchTransfer {
        max: u32,
        min: u32,
    },
    InstantiateCW721Error {
    },
    InvalidReplyID {
    },
    InvalidTokenId {
    },
    TokenIdAlreadySold {
        token_id: u32,
    },
    SoldOut {
    },
    MaxPerTxLimitExceeded {
    },
    InvalidBaseTokenURI {
    },
}

pub enum ExecuteMsg {
    Mint {
        token_id: u32,
    },
    BatchMint {
        token_ids: Vec<u32>,
    },
    MintTo {
        token_id: u32,
        recipient: String,
    },
    TransferNft {
        recipient: String,
        token_id: u32,
    },
    BatchTransferNft {
        recipient: String,
        token_ids: Vec<u32>,
    },
}

pub enum MinterQueryMsg {
    GetConfig {
    },
    RoyaltyInfo {
        sale_price: Uint128,
    },
    OwnerOf {
        token_id: String,
        include_expired: Option<bool>,
    },
    AllOperators {
        owner: String,
        include_expired: Option<bool>,
        start_after: Option<String>,
        limit: Option<u32>,
    },
    NumTokens {
    },
    ContractInfo {
    },
    NftInfo {
        token_id: String,
    },
    AllNftInfo {
        token_id: String,
        include_expired: Option<bool>,
    },
    Tokens {
        owner: String,
        start_after: Option<String>,
        limit: Option<u32>,
    },
    AllTokens {
        start_after: Option<String>,
        limit: Option<u32>,
    },
}
